import "./navbar.css";

const Navbar = () => {
    return (
        <div className = "nav-container">
            <nav className = "navbar">
                <h1 className = "navbar-logo">Shop</h1>                
                <CartWidget>
                    <img src="../CartWidget/icon-cart.svg" alt></img>
                </CartWidget>
            </nav>
        </div>
    );
};

export default Navbar;
